{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/marquesigor/portuguese-housing-market-capstone-project?scriptVersionId=251901837\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"9d636ef5","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","papermill":{"duration":0.00553,"end_time":"2025-07-22T18:20:53.30604","exception":false,"start_time":"2025-07-22T18:20:53.30051","status":"completed"},"tags":[]},"source":["**1. 🧠 Introduction**\n","\n","This notebook is part of the final Capstone Project (Track B) for the [Google Data Analytics Professional Certificate](https://www.coursera.org/professional-certificates/google-data-analytics).\n","\n","The project originated from a very real and personal question: *\"Can I actually afford a home in Portugal?\"* (spoiler: not really). From this starting point, I decided to investigate housing prices using data from Idealista, and later expand into macroeconomic indicators to better understand trends in affordability and housing accessibility across Portugal.\n","\n","This notebook is **iterative by design** and will be updated as more data is added (INE, BdP, migration, wages, etc). All data cleaning was done in R and is available on GitHub.\n","\n","🔗 [GitHub Repository](https://github.com/igor-marques/portugal-housing-market-capstone)\n","\n","⚠️ *Note: LLMs (ChatGPT and Manus.IM) were consulted during development.*"]},{"cell_type":"markdown","id":"64aa092c","metadata":{"papermill":{"duration":0.003954,"end_time":"2025-07-22T18:20:53.314762","exception":false,"start_time":"2025-07-22T18:20:53.310808","status":"completed"},"tags":[]},"source":["**2. 📁 Data Preparation**\n","\n","*2.1 Idealista Data*\n","Initial data source: cleaned Idealista price records for sale and rental housing across Portuguese regions (including archipelagos, later consolidated).\n","- Cleaned using R scripts\n","- Uploaded as long-format CSV: `idealista_prices_consolidated.csv`\n","- Dates range: ~2015 to early 2025\n","\n","*2.2 Other Sources (Planned)*\n","- INE: minimum/average wages, new construction, household size\n","- Banco de Portugal: interest rates, lending trends\n","- Migration data: internal and international"]},{"cell_type":"code","execution_count":1,"id":"5078ec02","metadata":{"execution":{"iopub.execute_input":"2025-07-22T18:20:53.329226Z","iopub.status.busy":"2025-07-22T18:20:53.326439Z","iopub.status.idle":"2025-07-22T18:20:55.238822Z","shell.execute_reply":"2025-07-22T18:20:55.236038Z"},"papermill":{"duration":1.923212,"end_time":"2025-07-22T18:20:55.24213","exception":false,"start_time":"2025-07-22T18:20:53.318918","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘lubridate’\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m4638\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m5\u001b[39m\n"]},{"name":"stderr","output_type":"stream","text":["\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (2): region, price_type\n","\u001b[32mdbl