dealista_data %>%\n","  filter(region == \"portugal\") %>%\n","  group_by(price_type) %>%\n","  # First calculate the average price for 2015\n","  mutate(\n","    avg_2015 = mean(price_per_sqm[year(date) == 2015], na.rm = TRUE),\n","    # Then calculate the index based on this average\n","    index = price_per_sqm / avg_2015 * 100\n","  )\n","\n","# Plot indexed evolution\n","ggplot(base_index, aes(x = date, y = index, color = price_type)) +\n","  geom_line(size = 1.2) +\n","  labs(\n","    title = \"Housing Price Evolution in Portugal (Index: 2015 Average = 100)\",\n","    y = \"Index\", x = NULL,\n","    color = \"Type\"\n","  ) +\n","  theme_minimal(base_size = 20)"]},{"cell_type":"markdown","id":"3d377a0b","metadata":{"papermill":{"duration":0.010998,"end_time":"2025-07-22T18:20:57.22433","exception":false,"start_time":"2025-07-22T18:20:57.213332","status":"completed"},"tags":[]},"source":["The normalized index (2015 Average = 100) reveals distinct growth patterns in Portugal's housing market:\n","* Sale prices have shown relatively steady linear growth since 2015, increasing by approximately 150% to reach about 250 on the index (2.5× the 2015 average). This consistent upward trajectory was only briefly interrupted by the anomalous spike in 2018-2019.\n","* Rental prices have demonstrated more aggressive and volatile growth over the same period. After initially outpacing sales until 2020, they experienced a plateau during the pandemic, then accelerated dramatically from 2022 onward. Rental prices have now reached approximately 320 on the index, representing a 220% increase (3.2× the 2015 average).\n","* Diverging patterns: While both markets have grown substantially, the rental market shows more pronounced volatility and has widened its growth differential particularly in the post-pandemic period (2022-2025), suggesting different market dynamics affecting each segment.\n","\n","The spike around early 2018 in the \"sale\" price index (and also slightly mirrored in rentals) likely indicates a data artifact, possibly due to:\n","\n","* Erroneous value(s) in Idealista listings for Portugal as a whole (e.g., a district or island temporarily reporting extreme values).\n","* Aggregation issue — maybe some smaller region had anomalously high prices and wasn’t properly diluted in the average.\n","* Scraping glitch — sometimes data pipelines pull erroneous values from listing platforms during updates.\n","* Outlier sale(s) — a few unusually expensive properties (e.g., luxury listings) might distort the average in smaller regions.\n","\n","These anomalies raise questions about the consistency of listing-based sources. To better understand if these spikes reflect real market trends or data artifacts, we will be incorporating official datasets from INE, Banco de Portugal, and others as the project progresses."]},{"cell_type":"markdown","id":"c4de56e4","metadata":{"papermill":{"duration":0.011058,"end_time":"2025-07-22T18:20:57.24651","exception":false,"start_time":"2025-07-22T18:20:57.235452","status":"completed"},"tags":[]},"source":["**3.2 Correlation Between Regions and National Average**\n","\n","We can correlate each region’s trend with the national average. Regions with low correlation may behave differently from the overall trend — either lagging or diverging in dynamics.\n","\n","*3.2.1 Rentals*"]},{"cell_type":"code","execution_count":5,"id":"6b6ea0cc","metadata":{"execution":{"iopub.execute_input":"2025-07-22T18:20:57.272522Z","iopub.status.busy":"2025-07-22T18:20:57.270877Z","iopub.status.idle":"2025-07-22T18:20:57.336109Z","shell.execute_reply":"2025-07-22T18:20:57.334309Z"},"papermill":{"duration":0.082062,"end_time":"2025-07-22T18:20:57.339609","exception":false,"start_time":"2025-07-22T18:20:57.257547","status":"completed"},"tags":[]},"outputs":[],"source":["library(dplyr)\n","library(tidyr)\n","library(ggplot2)\n","\n","# Choose price_type to analyze: 'rental' or 'sale'\n","price_type_filter <- \"rental\"\n","\n","# Filter data and pivot\n","regional_matrix <- idealista_data %>%\n","  filter(price_type == price_type_filter) %>%\n","  select(date, region, price_per_sqm) %>%\n","  pivot_wider(names_from = region, values_from = price_per_sqm)\n","\n","# Compute correlation matrix (ignoring rows with NA)\n","cor_matrix <- cor(regional_matrix %>% select(-date), use = \"pairwise.complete.obs\")\n","\n","# Extract correlation with 'portugal' column only\n","portugal_corr <- cor_matrix[\"portugal\", ]\n","portugal_corr_df <- data.frame(\n","  region = names(portugal_corr),\n","  correlation = as.numeric(portugal_corr)\n",") %>%\n","  filter(region != \"portugal\") %>%\n","  arrange(correlation)"]},{"cell_type":"code","execution_count":6,"id":"03931846","metadata":{"execution":{"iopub.execute_input":"2025-07-22T18:20:57.365515Z","iopub.status.busy":"2025-07-22T18:20:57.363648Z","iopub.status.idle":"2025-07-22T18:20:57.717583Z","shell.execute_reply":"2025-07-22T18:20:57.714512Z"},"papermill":{"duration":0.372678,"end_time":"2025-07-22T18:20:57.72333","exception":false,"start_time":"2025-07-22T18:20:57.350652","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABwgAAASwCAIAAABggIlUAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AUxd/A8bmSSy69BwhFepEmIIKAoihIFUVFBVGxPCp/EUGKAlaKVBELIoKi\nAqJSlCZVOohIL6EHCCUkIaRdLrmyz4u9XEJyOVIutwn3/bya7M3O/Xayu2F/zMyqJEkSAAAA\nAAAAAOBJ1EoHAAAAAAAAAADuRmIUAAAAAAAAgMchMQoAAAAAAADA45AYBQAAAAAAAOBxSIwC\nAAAAAAAA8DgkRgEAAAAAAAB4HBKjAAAAAAAAADwOiVEAAAAAAAAAHofEKAAAAAAAAACPQ2IU\nAAAAAAAAgMchMQoAAAAAAADA45AYBQAAAAAAAOBxSIwCAAAAAAAA8DgkRgEAAAAAAAB4HBKj\nAAAAAAAAADyOVukAgNvBhcM71q5du279llNxV65dS0i6YfANCg4JDa/ftFWbtu379O/fOEqv\ndIwAAAAAAADIxYhRoFRObfiuV+vqNZq2f3X4J7+v23rw2KkriTeyzdk3kq6dO3XsryU/fvjO\nq82iwx/qN/pEuknpYN0q9fwYVY7VyUb3B5B0vI89gNgsi/sDKLdK0zOGhIX2fefGG8ooQiFE\nbb2X/YsenLKv6DvG/tHJvuPSpMyyi9AhTzjryujSliwpNfP80lUq1cTYVFc1DsVIWa83ClWp\nVG0//lfpUMq1wi6rtAs/6NRqrS5yVVnebwEAADwZiVGghCRL+szXO9Z7+JUV/150XtNqMWxc\nOKFZ9VbzDye7Jzbgdr