rary(ggplot2)\n","library(scales)\n","\n","# Choose price_type to analyze: 'rental' or 'sale'\n","target_type <- \"rental\"\n","\n","# Subset by price type\n","regional_plot_data <- idealista_data %>%\n","  filter(price_type == target_type)\n","\n","# Separate Portugal (national average) and other regions\n","portugal_data <- regional_plot_data %>% filter(region == \"portugal\")\n","regional_data <- regional_plot_data %>% filter(region != \"portugal\")\n","\n","# Create a color palette for 20 regions\n","region_palette <- hue_pal()(length(unique(regional_data$region)))\n","names(region_palette) <- sort(unique(regional_data$region))\n","\n","# Plot\n","ggplot() +\n","  geom_line(data = regional_data, aes(x = date, y = price_per_sqm, color = region),\n","            size = 1.1, alpha = 0.7) +\n","  geom_line(data = portugal_data, aes(x = date, y = price_per_sqm),\n","            color = \"black\", size = 1.8) +  # Portugal line\n","  scale_color_manual(values = region_palette) +\n","  labs(\n","    title = paste(\"Housing Price Evolution by Region (\", target_type, \")\", sep = \"\"),\n","    y = \"€/m²\", x = NULL, color = \"Region\"\n","  ) +\n","  guides(\n","    color = guide_legend(\n","      override.aes = list(size = 1.1),\n","      title = \"Region\"\n","    ),\n","    fill = \"none\"\n","  ) +\n","  theme_minimal(base_size = 20) +\n","  theme(\n","    legend.position = \"right\",\n","    plot.title = element_text(face = \"bold\"),\n","    legend.key.height = unit(0.5, \"cm\"),\n","    legend.key.width = unit(0.5, \"cm\")\n","  ) +\n","  annotate(\"text\", x = max(portugal_data$date), y = tail(portugal_data$price_per_sqm, 1),\n","           label = \"Portugal (avg)\", hjust = -0.1, vjust = 0, fontface = \"bold\", color = \"black\")\n"]},{"cell_type":"markdown","id":"aac8803f","metadata":{"papermill":{"duration":0.02632,"end_time":"2025-07-22T18:20:58.558599","exception":false,"start_time":"2025-07-22T18:20:58.532279","status":"completed"},"tags":[]},"source":[