nnotate(\"text\", x = max(portugal_data$date), y = tail(portugal_data$price_per_sqm, 1),\n","           label = \"Portugal (avg)\", hjust = -0.1, vjust = 0, fontface = \"bold\", color = \"black\")\n"]},{"cell_type":"markdown","id":"3be101fb","metadata":{"papermill":{"duration":0.036058,"end_time":"2025-07-22T18:20:59.881826","exception":false,"start_time":"2025-07-22T18:20:59.845768","status":"completed"},"tags":[]},"source":["**🧠 Insight: Regional Divergence in Housing Sale Prices**\n","\n","When comparing how closely each region’s housing price trend correlates with the national average, we uncover a noteworthy distinction:\n","\n","* Rental prices exhibit strong correlation across all districts and archipelagos, indicating that rental markets in Portugal move in sync. This likely reflects broad national-level drivers, such as:\n","1. Wage evolution\n","2. Inflation\n","3. National legislation or housing benefit policies\n","4. Generalized demand in urban vs. rural areas\n","\n","* Sale prices, however, reveal a much more fragmented and region-specific behavior. Several districts — including Portalegre, Castelo Branco, Beja, and Vila Real — display weak correlation (*R²* < 0.75) with the national trend. This suggests that housing sales are driven by local dynamics, potentially involving:\n","\n","1. Regional economic growth or stagnation\n","2. Internal migration and population decline or concentration\n","3. Urban development projects or lack thereof\n","4. Local market saturation, aging population, or speculative investment\n","\n","📌 Noteworthy event: The COVID-19 pandemic appears to have caused a temporary deceleration in rental price increases around 2020. Interestingly, a sharp uptick resumes around late 2022, which may reflect factors such as inflation, interest rate hikes (impacting buying affordability), and the resurgence of urban rental demand post-pandemic.\n","\n","🧭 Takeaway: While rental markets appear to follow the same rhythm across the country, homeownership dynamics are locally nuanced."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":7828255,"sourceId":12412541,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":10.631706,"end_time":"2025-07-22T18:21:00.041464","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-07-22T18:20:49.409758","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}